import java.util.HashMap;
import java.util.List;
import java.util.ArrayList;
import java.util.Map;
import java.util.Map.Entry;
import java.lang.reflect.Field;
import java.math.BigInteger;

class PackedStruct {
    // map => start + class => start, start+bitlength => num => clazz.cast(num)
    HashMap<String, Pair<Integer, Class<? extends Number>>> indexMap = new HashMap<>();
    BigInteger packed;

    public static PackedStruct pack(HashMap<String, Number> map) {
        return new PackedStruct(map);
    }

    public PackedStruct(HashMap<String, Number> map) {
        int totalbits = 0;
        for (Number num : map.values()) {
            totalbits += getBitLength(num.getClass());
        }
        packed = BigInteger.valueOf(2).pow(totalbits - 1);
        int start = 0;
        for (Entry<String, Number> entry : map.entrySet()) {
            indexMap.put(entry.getKey(),
                    new Pair<Integer, Class<? extends Number>>(start, getClass(entry.getValue())));
            List<Integer> binList = getBinaryList(entry.getValue());
            for (int i = 0; i < binList.size(); i++) {
                if (binList.get(i) == 1)
                    packed = packed.setBit(start + i);
                else
                    packed = packed.clearBit(start + i);
            }
            start += getBitLength(getClass(entry.getValue()));
        }
    }

    public Class<? extends Number> getClass(Number num) {
        return num.getClass();
    }

    public Number get(String name, boolean cast) {
        Pair<Integer, Class<? extends Number>> pair = indexMap.get(name);
        List<Integer> binList = new ArrayList<>();
        for (int i = 0; i < getBitLength(pair.getSecond()); i++) {
            if (packed.testBit(pair.getFirst() + i)) {
                binList.add(1);
            } else {
                binList.add(0);
            }
        }
        return binToNumber(binList, pair.getSecond(), cast);
    }

    public int getInt(String name) {
        return 0;
    }

    public static int bigIntBits(BigInteger num) {
        return num.bitLength();
    }

    public static Number binToNumber(List<Integer> binaryList, Class<? extends Number> type, boolean cast) {
        StringBuilder binaryStringBuilder = new StringBuilder();
        for (Integer digit : binaryList) {
            binaryStringBuilder.append(digit);
        }
        String binaryString = binaryStringBuilder.toString();
        if (!cast) return Integer.parseInt(binaryString, 2);
        else return type.cast(Integer.parseInt(binaryString, 2));
    }

    public List<Integer> getBinaryList(Number number) {
        int binaryLength = getBitLength(getClass(number));
        String binaryString = Long.toBinaryString(number.longValue());
        int zerosToPad = Math.max(0, binaryLength - binaryString.length());
        String paddedBinaryString;
        if (zerosToPad > 0) {
            paddedBinaryString = String.format("%0" + zerosToPad + "d", 0) + binaryString;
        } else
            paddedBinaryString = binaryString;
        List<Integer> binaryList = new ArrayList<>();
        for (char c : paddedBinaryString.toCharArray()) {
            binaryList.add(Character.getNumericValue(c));
        }
        return binaryList;
    }

    public static int getBitLength(Class<? extends Number> clazz) {
        try {
            Field bitsField = clazz.getDeclaredField("SIZE");
            return (int) bitsField.get(null);
        } catch (Exception e) {
            return 0;
        }
    }
}

class Pair<A, B> {
    private final A first;
    private final B second;

    public Pair(A first, B second) {
        this.first = first;
        this.second = second;
    }

    public A getFirst() {
        return first;
    }

    public B getSecond() {
        return second;
    }

    @Override
    public String toString() {
        return "(" + first + ", " + second + ")";
    }
}

class HelloWorld {
    public static void main(String[] args) {
        Integer s = 30;
        HashMap<String, Number> map = new HashMap<>();
        map.put("test", 30);
        map.put("hello", 3.3F);
        PackedStruct packedStruct = new PackedStruct(map);
        System.out.println(packedStruct.get("test", false));
        System.out.println(packedStruct.get("hello", true));
    }
}

